import React from 'react';
import './Counter.css';

class CounterClass extends React.Component{
    constructor(props) {
        //wywołuję konstruktor dla component
        super(props);
    }

    render (){
        const text='komponent';
            const color = {
                'backbroundColor': this.props.color
            }
            return(
                <div className='counter-dark' style={color}>
                    <h1>{text}</h1>
                </div>
            )
      
    }
} 

export default CounterClass;
